function wp_has_consent(category){var consent_type=window.wp_consent_type;var has_consent_level=false;var cookie_value=consent_api_get_cookie(category);if(!consent_type){has_consent_level=true}else if(consent_type.indexOf("optout")!==-1&&cookie_value===""){has_consent_level=true}else{has_consent_level=cookie_value==="allow"}return has_consent_level}function consent_api_setcookie(name,value){var secure=";secure";var days=consent_api.cookie_expiration;var date=new Date;date.setTime(date.getTime()+days*24*60*60*1e3);var expires=";expires="+date.toGMTString();if(window.location.protocol!=="https:")secure="";document.cookie=name+"="+value+secure+expires+";path=/"}function consent_api_get_cookie(cname){var name=cname+"=";var cArr=window.document.cookie.split(";");for(var i=0;i<cArr.length;i++){var c=cArr[i].trim();if(c.indexOf(name)==0)return c.substring(name.length,c.length)}return""}function wp_set_consent(category,value){if(value!=="allow"&&value!=="deny")return;consent_api_setcookie("wp_consent_"+category,value);var changedConsentCategory=[];changedConsentCategory[category]=value;console.log("trigger hook");$.event.trigger({type:"wp_listen_for_consent_change",changedConsentCategory:changedConsentCategory})}jQuery(document).ready(function($){"use strict";window.wp_consent_type=consent_api.consent_type;$.event.trigger({type:"wp_set_consent_type",consent_type:window.wp_consent_type})});document.addEventListener("my_event",function(e){console.log(e.detail)});var detail="Event fired";try{var event=new CustomEvent("my_event",{detail:detail})}catch(err){var event=document.createEvent("Event");event.initEvent("my_event",true,true);event.detail=detail}document.dispatchEvent(event);